class Solution(object):
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        hm = {}
        if len(nums) < 3:
            return []
        if list(set(nums)) == [0]:
            return [(0,0,0)]
        for idx, n in enumerate(nums):
            key = 0 - n
            hm[key] = idx
    
        result_idx = set()
        for i, n1 in enumerate(nums):
            # print(i, "outer loop")
            for j, n2 in enumerate(nums):
                if i == j:
                    continue
                key = (n1 + n2)
                if key in hm:
                    k = hm[key]
                    if k == i or k == j:
                        continue
                    result_idx.add(tuple(sorted((i, j, hm[key]))))
        result = set()
        for v in result_idx:
            result.add(tuple(sorted(nums[idx] for idx in v)))
        return result

